import React, { useState } from 'react'
import Planet from './planet/planet'
function Planets()  {
    const [cars, setCars] = useState(
        [
        {name: 'Ford', year: 2018},
      {name: 'Audi', year: 2016},
      {name: 'Mazda', year: 2010}
        ]
    );
  

   
    return (
      <div style={{
        width: 400,
        margin: 'auto',
        paddingTop: '20px'
      }}>
        <Planet></Planet>
      </div>
    )
}
